import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import {Connected} from './Connected';
import {Button} from "react-bootstrap";
import Logo from '../src/static/Cloud_Logo.png'
import Background from '../src/static/Default_Mint.png';
import './App.css';


function App() {
    return(

            <div styles = {{backgroundImage:`url("${Background}")`,  backgroundPosition:'center'}}>
            <h3>Sales Forecasting
                <img src={Logo} alt="Main Logo" hspace="20"/>
            </h3>
                <Button variant="light" onClick={() => <Connected/>}>Log in to QuickBooks</Button>
            </div>

    );
}
export default App;
